var title_f42_33_43542="Diffuse osteoblastic metastases in prostate cancer";
var content_f42_33_43542=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F83138&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F83138&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 601px\">",
"   <div class=\"ttl\">",
"    Diffuse osteoblastic metastases in prostate cancer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 581px; height: 491px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The bone scan and T2 weighted midsagittal image of the thoracic spine is from a 50-year-old male with known prostate carcinoma. The bone scan (A) shows extensive osteoblastic metastases involving almost all the visualized bones including the entire spine, pubic symphysis, and probably sternum. The MRI (B) shows diffuse heterogeneity and a compression of T11 (red arrow). The findings are consistent with extensive blastic metastasis from primary prostate carcinoma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
