var title_f42_33_43548="Nasal irrigation instruct";
var content_f42_33_43548=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F71059&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F71059&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    How to perform nasal irrigation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Buffered normal saline nasal irrigation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        The benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Saline (saltwater) washes the mucus and irritants from your nose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. The sinus passages are moisturized.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Studies have also shown that a nasal irrigation improves cell function (the cells that move the mucus work better).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        The recipe",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Use a one-quart glass jar that is thoroughly cleansed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        You may use a large medical syringe (30 cc), water pick with an irrigation tip (preferred method), squeeze bottle, or Neti pot. Do not use a baby bulb syringe. The syringe or pick should be sterilized frequently or replaced every two to three weeks to avoid contamination and infection.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fill with water that has been distilled, previously boiled, or otherwise sterilized. Plain tap water is not recommended because it is not necessarily sterile.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Add 1 to 1&nbsp;",
"        <span style=\"font-family: calibri; font-size: 16px;\">",
"         &frac12;",
"        </span>",
"        &nbsp; heaping teaspoons of pickling/canning salt. Do NOT use table salt because it contains a large number of additives.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Add 1 teaspoon baking soda (pure bicarbonate).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mix ingredients together and store at room temperature. Discard after&nbsp;one week.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        You may also make up a solution from premixed packets that are commercially-prepared specifically for nasal irrigation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        The instructions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Irrigate your nose with saline one to two times per day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <ul>",
"         <li>",
"          If you have been told to use nasal medication, you should always use your saline solution first. The nasal medication is much more effective when sprayed onto clean nasal membranes, and the spray will reach deeper into the nose.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <ul>",
"         <li>",
"          Pour the amount of fluid you plan to use into a clean bowl. DO NOT put your used syringe back into the storage container because it contaminates your solution.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <ul>",
"         <li>",
"          You may warm the solution slightly in the microwave, but be sure that the solution is NOT HOT.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <ul>",
"         <li>",
"          Bend over the sink (some people do this in the shower) and squirt the solution into each side of your nose, aiming the stream toward the back of your head, NOT the top of your head. The solution should flow into one nostril and out the other, but it will not harm you if you swallow a little.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <ul>",
"         <li>",
"          Some people experience a little burning sensation the first few times they use buffered saline solution, but this usually goes away after they adapt to it.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Diseases of the Sinuses: Diagnosis and Management. Kennedy DW, Bolger WE, Zinreich SJ (Eds), BC Decker, Hamilton, Ontario 2001. Copyright &copy; Kennedy DW, Zinreich SJ.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
